      this.globalDialogService
        .showConfirmation(
          'Confirm Delete',
          'Are you sure you want to delete this record?'
        )
        .then((result) => {
          if (result) {
            this.deleteAppointment($event.data.apptId);
          }
        });
    } else {
      console.log('unhandled action', $event);
    }
  }
