    private globalDialogService: GlobalDialogService,
    private qualifyingExamService: QualifyingExamService
  ) {}
  // trainee
  @Action(GetDashboardProgramInformation) getDashboardProgramInformation(
    ctx: StateContext<IDashboardState>
