import { Injectable } from '@angular/core';
import {
  ActivatedRouteSnapshot,
  Router,
  RouterStateSnapshot,
  UrlTree,
} from '@angular/router';
import { Observable } from 'rxjs';
import { Select, Store } from '@ngxs/store';
import { AuthSelectors } from './auth.selectors';
import { UntilDestroy } from '@ngneat/until-destroy';

interface CanActivate {
  canActivate(
    route: ActivatedRouteSnapshot,
    state: RouterStateSnapshot
  ):
    | Observable<boolean | UrlTree>
    | Promise<boolean | UrlTree>
    | boolean
    | UrlTree;
}

@UntilDestroy()
@Injectable({
  providedIn: 'root',
})
export class AuthGuard implements CanActivate {
  @Select(AuthSelectors.slices.isAuthenticated) $isAuthenticated:
    | Observable<boolean>
    | undefined;
  @Select(AuthSelectors.slices.isPasswordReset) $isPasswordReset:
    | Observable<boolean>
    | undefined;
  @Select(AuthSelectors.claims) $claims: Observable<string[]> | undefined;
  constructor(private store: Store, private router: Router) {}

  // TODO: Explore using an async way to validate routes
  async test() {
    return 1;
  }

  canActivate(
    route: ActivatedRouteSnapshot,
    state: RouterStateSnapshot
  ):
    | Observable<boolean | UrlTree>
    | Promise<boolean | UrlTree>
    | boolean
    | UrlTree {
    const requiredClaims = route.data['requiredClaims'] as string[];
    const isAuthenticated = this.store.selectSnapshot(
      AuthSelectors.slices.isAuthenticated
    );
    const userClaims = this.store.selectSnapshot(AuthSelectors.claims) ?? [];

    // first check if the user is authenticated
    if (isAuthenticated) {
      // if there are claims required for the route check them
      if (requiredClaims && requiredClaims.length > 0) {
        if (this.checkClaims(userClaims, requiredClaims)) {
          // if the user has the required claims, allow the route
          return true;
        } else {
          // if the user does not have the required claims, redirect to unauthorized
          this.router.navigate(['/unauthorized']);
          return false;
        }
      } else {
        // if no claims are required, allow the route
        return true;
      }
    } else {
      // if not authenticated, redirect to login
      this.router.navigate(['/login'], {
        queryParams: { returnUrl: state.url },
      });
      return false;
    }
  }

  private checkClaims(userClaims: string[], requiredClaims: string[]) {
    return requiredClaims.every((claim) => userClaims.includes(claim));
  }
}

import { Injectable } from '@angular/core';
import { ActivatedRouteSnapshot, Router, UrlTree } from '@angular/router';
import { Observable, map, skipWhile, take } from 'rxjs';
import { Select } from '@ngxs/store';
import { ApplicationSelectors } from './application.selectors';
import { IFeatureFlags } from './application.state';

interface CanActivate {
  canActivate(
    route: ActivatedRouteSnapshot
  ):
    | Observable<boolean | UrlTree>
    | Promise<boolean | UrlTree>
    | boolean
    | UrlTree;
}

@Injectable({
  providedIn: 'root',
})
export class FeatureToggleGuard implements CanActivate {
  @Select(ApplicationSelectors.slices.featureFlags)
  featureFlags$!: Observable<IFeatureFlags>;

  constructor(private router: Router) {}

  /**
   *
   * @param route
   * @returns
   */
  canActivate(
    route: ActivatedRouteSnapshot
  ):
    | Observable<boolean | UrlTree>
    | Promise<boolean | UrlTree>
    | boolean
    | UrlTree {
    const requiredFeatures = route.data['requiredFeatures'] as string[];
    return this.featureFlags$.pipe(
      /**
       * Skip while the feature flags are not loaded
       */
      skipWhile((enabledFeatures) => !enabledFeatures),
      /**
       * Take one emission and complete the observable
       */
      take(1),
      /**
       * Map the enabled features to a boolean
       * If the required features are not empty, check if all required features are enabled
       * If there are no required features or if all required features are enabled, return true
       * else navigate to page not found
       */
      map((enabledFeatures) => {
        if (requiredFeatures && requiredFeatures.length > 0) {
          if (this.checkFeatures(enabledFeatures, requiredFeatures)) {
            return true;
          } else {
            this.router.navigate(['/page-not-found']);
            return false;
          }
        } else {
          return true;
        }
      })
    );
  }

  /**
   *
   * @param enabledFeatures
   * @param requiredFeatures
   * @returns
   */
  private checkFeatures(
    enabledFeatures: IFeatureFlags,
    requiredFeatures: string[]
  ) {
    return requiredFeatures.every(
      (feature) => enabledFeatures[feature as keyof IFeatureFlags]
    );
  }
}

