import { AuthService } from '../../../api';
import {
  HttpErrorResponse,
  HttpEvent,
  HttpHandler,
  HttpInterceptor,
  HttpRequest,
} from '@angular/common/http';
import { Injectable } from '@angular/core';
import { BehaviorSubject, Observable, tap } from 'rxjs';
import { catchError, filter, switchMap, take } from 'rxjs/operators';
import { Store } from '@ngxs/store';
import { Logout, RefreshToken } from '../../../state';

@Injectable()
export class AuthInterceptor implements HttpInterceptor {
  private isRefreshing = false;
  private refreshTokenSubject: BehaviorSubject<any> = new BehaviorSubject<any>(
    null
  );
  constructor(private auth: AuthService, private store: Store) {}

  getAuthorizationToken(): string | undefined {
    //const accessToken = sessionStorage.getItem('access_token');
    const accessToken = this.store.selectSnapshot(
      (state) => state.auth.access_token
    );
    if (accessToken) {
      return `Bearer ${accessToken}`;
    }
    sessionStorage.clear();
    return;
  }

  intercept(req: HttpRequest<any>, next: HttpHandler) {
    // Get the auth token from the service.
    const authToken = this.getAuthorizationToken();

    // Clone the request and replace the original headers with
    // cloned headers, updated with the authorization.
    if (!authToken) {
      return next.handle(req).pipe(
        tap(() => {
          console.info('AuthInterceptor: No auth token found');
          this.handleAuthError(req, next);
        })
      );
    }
    const authReq = this.addToken(req, authToken);

    // send cloned request with header to the next handler.
    return next.handle(authReq).pipe(
      catchError((err) => {
        if (err instanceof HttpErrorResponse) {
          if (err.status === 401 || err.status === 403) {
            this.handleAuthError(req, next);
          }
        }
        throw err;
      })
    );
  }

  private addToken(req: HttpRequest<any>, token: string): HttpRequest<any> {
    return req.clone({
      headers: req.headers.set('Authorization', token),
    });
  }

  private handleAuthError(
    req: HttpRequest<any>,
    next: HttpHandler
  ): Observable<HttpEvent<any>> {
    if (!this.isRefreshing) {
      this.isRefreshing = true;
      this.refreshTokenSubject.next(null);

      return this.store.dispatch(new RefreshToken()).pipe(
        switchMap((token: any) => {
          this.isRefreshing = false;
          this.refreshTokenSubject.next(token.access_token);
          return next.handle(this.addToken(req, token.access_token));
        }),
        catchError((err) => {
          this.store.dispatch(new Logout());
          throw err;
        })
      );
    } else {
      return this.refreshTokenSubject.pipe(
        filter((token) => token != null),
        take(1),
        switchMap((token) => {
          return next.handle(this.addToken(req, token));
        })
      );
    }
  }
}

import {
  HttpErrorResponse,
  HttpHandler,
  HttpInterceptor,
  HttpRequest,
} from '@angular/common/http';
import { Injectable } from '@angular/core';
import { catchError } from 'rxjs/operators';

import { GlobalToastService } from '../../services/global-toast.service';

import { Store } from '@ngxs/store';

@Injectable()
export class ErrorInterceptor implements HttpInterceptor {
  constructor(
    private store: Store,
    private globalToastService: GlobalToastService
  ) {}

  intercept(req: HttpRequest<any>, next: HttpHandler) {
    const errorReq = req.clone();

    // send cloned request with header to the next handler.
    return next.handle(errorReq).pipe(
      catchError((err) => {
        if (err instanceof HttpErrorResponse) {
          // do not handle 401/404 errors here, they will be handled in the auth interceptor or the app respectively
          // carve out specifically for the Login Failed error as it is shaped differently from other errors
          if (
            (!err.error ||
              (typeof err.error === 'string' &&
                err.error !== 'Login failed')) &&
            err.status !== 401 &&
            err.status !== 403 &&
            err.status !== 404
          ) {
            // TODO: [Joe] - add error specific messages here

            const message = `${err.status} Error: ${err.statusText}`;
            // if (err.error) {
            //   message = err.error;
            // }
            this.globalToastService.showError(message);
          }
          //throw err;
          // log error to console for debugging
          console.log(err);
          console.log(`Error Code: ${err.status}\nMessage: ${err.message}`);
        }

        // always allow the error to continue to propagate
        throw err;
      })
    );
  }
}

