import {
  Component,
  CUSTOM_ELEMENTS_SCHEMA,
  forwardRef,
  Input,
  ViewChild,
} from '@angular/core';
import { CommonModule } from '@angular/common';
import {
  ControlValueAccessor,
  FormsModule,
  NG_VALUE_ACCESSOR,
  ReactiveFormsModule,
} from '@angular/forms';

function MakeProvider(type: any) {
  return {
    provide: NG_VALUE_ACCESSOR,
    useExisting: forwardRef(() => type),
    multi: true,
  };
}

@Component({
  selector: 'abs-input-checkbox',
  standalone: true,
  imports: [CommonModule, ReactiveFormsModule, FormsModule],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
  template: `
    <sl-checkbox
      #checkbox
      [name]="name"
      [value]="_value"
      [size]="size"
      [disabled]="disabled"
      [checked]="checked"
      [defaultChecked]="defaultChecked"
      [indeterminate]="indeterminate"
      [form]="form"
      [required]="required"
      (sl-change)="mapChangeEvent($event)"
      ><ng-content></ng-content
    ></sl-checkbox>
  `,
  providers: [MakeProvider(InputCheckboxComponent)],
})
export class InputCheckboxComponent implements ControlValueAccessor {
  @ViewChild('checkbox') checkbox: any;

  @Input() name: string | undefined;
  @Input() form = '';
  @Input() size: 'small' | 'medium' | 'large' = 'medium';

  _value = false;
  _disabled: boolean | string = false;
  _checked: boolean | string = false;
  _defaultChecked: boolean | string = false;
  _indeterminate: boolean | string = false;
  _required: boolean | string = false;

  @Input()
  get value(): boolean {
    return this._value;
  }
  set value(value: boolean) {
    if (value !== this._value) {
      this._value = value;
      this.onChange(value);
    }
  }
  @Input()
  get disabled(): boolean | string {
    return this._disabled;
  }
  set disabled(value: boolean | string) {
    this._disabled = value === '' || (value && value !== 'false');
  }
  @Input()
  get checked(): boolean | string {
    return this._checked;
  }
  set checked(value: boolean | string) {
    this._checked = value === '' || (value && value !== 'false');
  }

  @Input()
  get defaultChecked(): boolean | string {
    return this._defaultChecked;
  }
  set defaultChecked(value: boolean | string) {
    this._defaultChecked = value === '' || (value && value !== 'false');
  }

  @Input()
  get indeterminate(): boolean | string {
    return this._indeterminate;
  }
  set indeterminate(value: boolean | string) {
    this._indeterminate = value === '' || (value && value !== 'false');
  }
  @Input()
  get required(): boolean | string {
    return this._required;
  }
  set required(value: boolean | string) {
    this._required = value === '' || (value && value !== 'false');
  }

  writeValue(value: any) {
    this._value = this.checked = value;
    // warning: comment below if only want to emit on user intervention
    this.onChange(value);
  }

  onChange = (e: any) => {
    // console.log('checkbox onChange', e);
  };
  onTouched = () => {
    // console.log('checkbox onTouched');
  };
  registerOnChange(fn: (e: any) => void): void {
    this.onChange = fn;
  }
  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }

  // This is what makes the Shoelace input work with Angular forms
  mapChangeEvent($event: any) {
    this.value = this.checked = !this.value;
  }
}

/*
SHOELACE CHECKBOX API
Attributes & Properties
Name	Description	Reflects	Type	Default
name	The name of the checkbox, submitted as a name/value pair with form data.		string	''
value	The current value of the checkbox, submitted as a name/value pair with form data.		string	-
size	The checkbox's size.		'small' | 'medium' | 'large'	'medium'
disabled	Disables the checkbox.		boolean	false
checked	Draws the checkbox in a checked state.		boolean	false
indeterminate	Draws the checkbox in an indeterminate state. This is usually applied to checkboxes that represents a "select all/none" behavior when associated checkboxes have a mix of checked and unchecked states.		boolean	false
defaultChecked
(property only)	The default value of the form control. Primarily used for resetting the form control.		boolean	false
form	By default, form controls are associated with the nearest containing <form> element. This attribute allows you to place the form control outside of a form and associate it with the form that has this id. The form must be in the same document or shadow root for this to work.		string	''
required	Makes the checkbox a required field.		boolean	false
validity
(property only)	Gets the validity state object		-	-
validationMessage
(property only)	Gets the validation message		-	-
updateComplete	A read-only promise that resolves when the component has finished updating.
Learn more about attributes and properties.

Events
Name	Description	Event Detail
sl-blur	Emitted when the checkbox loses focus.	-
sl-change	Emitted when the checked state changes.	-
sl-focus	Emitted when the checkbox gains focus.	-
sl-input	Emitted when the checkbox receives input.	-
sl-invalid	Emitted when the form control has been checked for validity and its constraints aren't satisfied.	-
Learn more about listening to events.

Methods
Name	Description	Arguments
click()	Simulates a click on the checkbox.	-
focus()	Sets focus on the checkbox.
options: FocusOptions

blur()	Removes focus from the checkbox.	-
checkValidity()	Checks for validity but does not show a validation message. Returns true when valid and false when invalid.	-
getForm()	Gets the associated form, if one exists.	-
reportValidity()	Checks for validity and shows the browser's validation message if the control is invalid.	-
setCustomValidity()	Sets a custom validation message. The value provided will be shown to the user when the form is submitted. To clear the custom validation message, call this method with an empty string.
message: string
 */

import {
  Component,
  CUSTOM_ELEMENTS_SCHEMA,
  forwardRef,
  Input,
  ViewChild,
} from '@angular/core';
import { CommonModule } from '@angular/common';
import {
  ControlValueAccessor,
  FormsModule,
  NG_VALUE_ACCESSOR,
  ReactiveFormsModule,
} from '@angular/forms';

// This makes the component into a form control by forwarding the value accessor
function MakeProvider(type: any) {
  return {
    provide: NG_VALUE_ACCESSOR,
    useExisting: forwardRef(() => type),
    multi: true,
  };
}

@Component({
  selector: 'abs-input-radio-group',
  standalone: true,
  imports: [CommonModule, ReactiveFormsModule, FormsModule],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
  template: `
    <sl-radio-group
      [name]="name"
      [label]="label"
      [value]="value"
      [size]="size"
      [form]="form"
      [required]="required"
      (sl-change)="mapChangeEvent($event)"
    >
      <ng-content></ng-content>
    </sl-radio-group>
  `,
  providers: [MakeProvider(InputRadioGroupComponent)], // Super important
})
export class InputRadioGroupComponent implements ControlValueAccessor {
  @ViewChild('radioGroup') radioGroup: any;

  // Implement the API for the specific form control.
  @Input() name: string | undefined;
  @Input() label = '';
  @Input() form = '';
  @Input() size: 'small' | 'medium' | 'large' = 'medium';

  _value: any = '';
  _required: boolean | string = false;
  @Input()
  get value(): string | undefined {
    return this._value;
  }
  set value(value: string | undefined) {
    if (value !== this._value) {
      this._value = value;
      this.onChange(value);
    }
  }

  // For attributes that can have a shorthand, get/set functions are needed
  @Input()
  get required(): boolean | string {
    return this._required;
  }
  set required(value: boolean | string) {
    this._required = value === '' || (value && value !== 'false');
  }

  // This method is fired when the control is initially written by the form
  // control. This is where you want to write the initial value to the
  // component.
  // This mainly made a big difference for checkboxes and radio buttons
  writeValue(value: any) {
    this._value = value;
    // warning: comment below if only want to emit on user intervention
    this.onChange(value);
  }

  // Some of these are left empty but are here to satisfy the interface...
  // I think
  onChange = (e: any) => {
    // console.log('onChange');
  };
  onTouched = () => {
    // console.log('onTouched');
  };
  // Very important
  registerOnChange(fn: (e: any) => void): void {
    this.onChange = fn;
  }
  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }

  // This is what makes the input work with Angular forms
  // It is basically a listener for the sl-change event to do what is needed for the
  // form.
  mapChangeEvent($event: any) {
    const target = $event.target as HTMLSelectElement;
    this.value = target.value;
  }
}

import {
  Component,
  CUSTOM_ELEMENTS_SCHEMA,
  forwardRef,
  Input,
} from '@angular/core';
import { CommonModule } from '@angular/common';
import {
  ControlValueAccessor,
  FormsModule,
  NG_VALUE_ACCESSOR,
  ReactiveFormsModule,
} from '@angular/forms';

function MakeProvider(type: any) {
  return {
    provide: NG_VALUE_ACCESSOR,
    useExisting: forwardRef(() => type),
    multi: true,
  };
}

@Component({
  selector: 'abs-input-select',
  standalone: true,
  imports: [CommonModule, ReactiveFormsModule, FormsModule],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
  template: `
    <sl-select
      [name]="name"
      [placeholder]="placeholder"
      [label]="label"
      [value]="value"
      [size]="size"
      [multiple]="multiple"
      [open]="open"
      [hoist]="hoist"
      [form]="form"
      [clearable]="clearable"
      [disabled]="disabled"
      [helpText]="helpText"
      [required]="required"
      (sl-change)="mapChangeEvent($event)"
    >
      <ng-content></ng-content>
    </sl-select>
  `,
  providers: [MakeProvider(InputSelectComponent)],
})
export class InputSelectComponent implements ControlValueAccessor {
  @Input() name: string | undefined;
  @Input() label = '';
  @Input() placeholder: string | undefined;
  @Input() displaytext: string | undefined;
  @Input() helpText = '';
  @Input() form = '';
  @Input() placement: 'top' | 'bottom' = 'bottom';
  @Input() size: 'small' | 'medium' | 'large' = 'medium';

  _value: any = '';
  _disabled: boolean | string = false;
  _open: boolean | string = false;
  _hoist: boolean | string = false;
  _filled: boolean | string = false;
  _pill: boolean | string = false;
  _multiple: boolean | string = false;
  _clearable: boolean | string = false;
  _required: boolean | string = false;
  @Input()
  get value(): string | undefined {
    return this._value;
  }
  set value(value: string | undefined) {
    if (value !== this._value) {
      this._value = value;
      this.onChange(value);
    }
  }
  @Input()
  get disabled(): boolean | string {
    return this._disabled;
  }
  set disabled(value: boolean | string) {
    this._disabled = value === '' || (value && value !== 'false');
  }
  @Input()
  get multiple(): boolean | string {
    return this._multiple;
  }
  set multiple(value: boolean | string) {
    this._multiple = value === '' || (value && value !== 'false');
  }

  // TODO: <Alan> this currently does set the component to the open state,
  //  however the selects in the ng-content are not opened. Explore
  @Input()
  get open(): boolean | string {
    return this._open;
  }
  set open(value: boolean | string) {
    this._open = value === '' || (value && value !== 'false');
  }

  @Input()
  get hoist(): boolean | string {
    return this._hoist;
  }
  set hoist(value: boolean | string) {
    this._hoist = value === '' || (value && value !== 'false');
  }

  @Input()
  get clearable(): boolean | string {
    return this._clearable;
  }
  set clearable(value: boolean | string) {
    this._clearable = value === '' || (value && value !== 'false');
  }
  @Input()
  get required(): boolean | string {
    return this._required;
  }
  set required(value: boolean | string) {
    this._required = value === '' || (value && value !== 'false');
  }

  @Input()
  get filled(): boolean | string {
    return this._filled;
  }
  set filled(value: boolean | string) {
    this._filled = value === '' || (value && value !== 'false');
  }
  @Input()
  get pill(): boolean | string {
    return this._pill;
  }
  set pill(value: boolean | string) {
    this._pill = value === '' || (value && value !== 'false');
  }

  writeValue(value: any) {
    this._value = value;
    // warning: comment below if only want to emit on user intervention
    this.onChange(value);
  }

  onChange = (_: any) => {
    // console.log('onChange');
  };
  onTouched = () => {
    // console.log('onTouched');
  };
  registerOnChange(fn: (_: any) => void): void {
    this.onChange = fn;
  }
  registerOnTouched(fn: () => void): void {
    this.onTouched = fn;
  }

  // This is what makes the Shoelace input work with Angular forms
  mapChangeEvent($event: any) {
    const target = $event.target as HTMLSelectElement;
    this.value = target.value;
  }
}

