@Component({
  selector: 'abs-outcome-registries-modal',
  standalone: true,
  imports: [
    CommonModule,
    FormsModule,
    ReactiveFormsModule,
    SuccessFailModalComponent,
    RadioButtonModule,
    InputTextareaModule,
    CheckboxModule,
    ButtonModule,
  ],
